script: |
  super -f text -I q3455.spq | sort > q3455.out

inputs:
  - name: q3455.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + col0 NOT BETWEEN ( - 71 * CAST ( NULL AS INTEGER ) ) AND + 33;
  - name: tab1

outputs:
  - name: q3455.out
    data: |
      51	14	96
      85	5	59
      91	47	68
